    const history=useHistory();
    const [selectedImage, setSelectedImage] = useState(null);

    const id= window.sessionStorage.getItem("userId");

    const [doctorDetails,setDoctorDetails]=useState({
      firstName: "",
      lastName: "",
      gendeer: "",
      email: "",
      mobNumber: "",
      password: "",
